import { Box, Avatar } from '@material-ui/core';

const Conversation = ({ user }) => {
    const url = user.imageUrl;

    return (
        <Box>
           <Box>
               <Avatar src={url} alt="contact-picture"/>    
           </Box>        
        </Box>
    )
}

export default Conversation;
